import React from "react";
import Services from './Services';

const About = () => {
  return (
    <section id="about" className="min-h-screen bg-black-400 text-white px-4 py-12">
      <div className="container mx-auto px-6">
        <h3 className="text-3xl font-bold text-center mb-6">About Us</h3>
        <p className="max-w-3xl mx-auto text-center text-lg">
          Ekarit is a visa and other Services solutions provider committed to delivering your requirements.
        </p>
      </div>
    </section>
  );
};

export default About;
